import React from 'react';
import './App.css';
import { NotesList } from './components/NotesList';
import 'antd/dist/antd.css';
import NoteFrom from './components/NoteFrom';

function App() {
  return (
    <div style={{margin :'20px', backgroundColor:'Green'}}>
      <NoteFrom></NoteFrom>
      <NotesList></NotesList>
    </div>
  );
}

export default App;
